//SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

struct IoTDevice{
    string mac_address;
    string did_address;
    string [] data_hash;
}

struct SeedCertificationAgency{
    string lab_name;
    string lab_location;
    string lab_uid;
}

struct SeedCertificationResults{
    uint laboratory_index;
    //identify the various results that found for each and every result and then create 
    //a field for it in this array yayy.
    string field_inspection_result;
    string bulk_inspection_result;
}

struct Seed{
    //crop whose seed it is
    string name;
    //store ipfs hash address of the seed producer details.
    string seed_producer_bc_add;
    SeedCertificationResults certification_results;   
}


struct SeedProducer{
    string name;
    string location;
    string blockchain_address;
    //the weighing scales are the iot devices which are present at the seed producer.
    mapping(string => IoTDevice) iot_devices;
}

struct Farm{
    string location;
    uint field_area;
    //here the key is the did address of the iot device...this can be changed to the mac address as well
    //or to any other field
    mapping(string => IoTDevice) iot_devices;}

struct Farmer{
    string blockchain_address;
    string name;
    string location;
    mapping(string => Farm) farms;
}

struct Package{
    //all this is stored in ipfs.
    // uint box_weight;
    // string source_add;
    //I'm thinking adding the logistics vehicle owner address who owns the vehicle.
    uint256 packaging_date;
    uint256 delivery_date;
    string uid;
}

struct Vehicle{
    string owner_bc_add;
    string vehicle_number;
    //this gps device will give the current location of the vehicle.
    IoTDevice iot_device;
}

struct Logistics_Company{
    string name;
    string head_office_location;
    mapping(string => Vehicle) vehicles;
}

struct Wholesaler{
    string blockchain_address;
    string name;
    string location;
}

struct Factory{
    string name;
    string location;
    mapping(string => IoTDevice) iot_devices;
}

struct Processor{
    string blockchain_address;
    string name;
    mapping(string => Factory) factories;
}

struct Distributor{
    string name;
}
struct Retailer{
    string name;
}
